    const [clost, setClose] = useState({
        style: {
            display: 'none'
        }
    })

    console.log(Cookies.get("token"));
    const create_new_customer = () => {
		console.log(Cookies.get("token"));
		fetch("http://localhost:5000/read-contacts", {
            method: "GET",
            data: {},
			mode: "cors",
			headers: {
				"Content-Type": "application/x-www-form-urlencoded",
				"Access-Control-Allow-Origin": "*",
				"x-access-token": Cookies.get("token"),
			},
		})
    }


	return (
        <>
        {/* <div  className='bg_blur'></div> */}
		<div  className='form_modal_wrapper'>
			<form  id='form-data'>
				<label id='email'>Name</label>
				<input
					className='cus-input'
					type='text'
					name='name'
					placeholder='Name'
					// onChange={(e) =>
					// 	setUser({ ...user, email: e.target.value })}>
				></input>
				<label id='email'>Number</label>
				<input
					className='cus-input'
					name='user'
					type='text'
					placeholder='647 123 4567'
					// onChange={(e) =>
					// 	setUser({ ...user, password: e.target.value })}
				></input>
				<input id='submit-btn' type='submit' value='Create Contact'></input>
			</form>
            {/* <input id='close-btn' value='close' type='button'></input> */}
		</div>
        </>
	);
};

export default FormModal;
